    Location of Wells with Water-Level Measurements taken in the Spring and Fall from
    September 1940 to April 2009 for the Northern High Plains Groundwater-Flow Model
    in Parts of Colorado, Kansas, Nebraska, South Dakota, and Wyoming",nt"tracking_summary":
    {ntt"total": 10,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-09-02T23:00:39.421069",nt"name": "ds-777-spatial-location-of-wells-with-water-level-measurements-taken-in-the-spring-and-fall-fro",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is one of many developed
    in support of The High Plains Groundwater Availability Project and the U.S. Geological
    Survey Data Series Report: Geodatabase Compilation of Hydrogeologic, Remote Sensing,
    and Water-Budget-Component data for the High Plains aquifer, 2011 (ds777). This
    dataset contains point vector data of 20,759 wells with 327,129 water-level measurement
    records located in areas overlying the northern High Plains aquifer in the United
    States. The northern High Plains aquifer underlies 61.7 million acres (96,400 square
    miles) in Colorado, Kansas, Nebraska, South Dakota, and Wyoming. These data were
    acquired from the U.S. Geological Survey National Water Information System (NWIS)
    and the High Plains water-level monitoring network maintained by Virginia McGuire.
    Included in this dataset is a point feature class (pts_WaterLevel_development) of
    water-level measurements in the northern High Plains aquifer for the northern High
    Plains groundwater-flow model development period October 1, 1940 to May 31, 2009
    in 138 stress periods.",nt"license_title": null,nt"extras": [{ntt"key":
